import React from 'react'

const Section = () => {
    return (
        <Container>
            <Wrapper>
                <Title>Small Lot </Title>
                <Text>Our most exclusive wines showcasing unique areas of clones. </Text>
            </Wrapper>
        </Container>
    )
}

export default Section
